import React from 'react';

function RowTable (props){
    
    const Keys = Object.keys(props.dataRow);
    const uid = props.dataRow.uid;
    
    return(
            <tr>
            {
              Keys.map( (keys, index)=>{
                return <td 
                            key = {index} 
                            uid = {props.dataRow.uid} 
                            onClick = {(event, {uid})=>props.onclick(event, {uid})}
                        >
        
                            {props.dataRow[keys]}
        
                        </td>
                }) 
            }
        
        </tr>
    )
}

export default RowTable
